import React from 'react'
import Popup from "reactjs-popup";

function Modal() {
    return (
        <Popup
            trigger={<button className="openModal"> Open Modal </button>}
            modal
            closeOnDocumentClick
        >
            <span> Modal content </span>
        </Popup>
    )
}

export default Modal
